// Barre de recherche

import { Button, Card, TextField } from '@mui/material';
import React from 'react';
import { makeStyles } from "@material-ui/core/styles";
import LocalFloristIcon from '@mui/icons-material/LocalFlorist';



const useStyles = makeStyles((theme) => ({
  search: {
    marginLeft: "12%",
    width: "75%",
    height: "50px",
    borderRadius: "5px",
    marginBottom: "30px",
    marginTop: "35px",
  },
  button: {
    borderRadius: "25px",
    backgroundColor: "#33FF93",
    color: "black",
    width: "75%",
    height: "50px",
    marginLeft: "12%",
    marginBottom: "10px",
  },
}));

export default function Search({ onChange, plante, searchValue }) {
  const classes = useStyles();
  return (

    <div>
      <Card style={{ height: "100%", width: "100%", marginTop: "20px", display: "flex", }}>
        <p style={{ marginLeft: "150px", marginTop: "95px", position: "absolute", fontSize: "1.73em" }}>Donnez à vos végétaux une seconde vie,</p>
        <p style={{ marginLeft: "150px", marginTop: "135px", position: "absolute", fontSize: "1.73em" }}>et achetez-en de nouveaux.</p>
        <img style={{ width: "100%", height: "100%", borderBottom: "0px" }} src="/ban-search.png" alt="bannière" />
        <Card style={{ height: "200px", width: "450px", marginLeft: "150px", marginTop: "200px", display: "flex", flexDirection: "column", position: "absolute" }}>
          <div style={{ height: "25px", width: "25px", marginLeft: "350px", marginTop: "50px", position: "absolute" }}>
            <LocalFloristIcon />
          </div>
          <TextField
            className={classes.search}
            value={searchValue}
            type="text"
            placeholder="Recherchez votre végétal"
            onChange={onChange}
          />
          <Button className={classes.button} onClick={plante} >RECHERCHER</Button>
        </Card>

        <div>


        </div>
      </Card>
    </div>


  );
}
